import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./Home";
import paymentSuccess from "./paymentSuccess";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/paymentsuccess" element={<PaymentSuccess />} />
      </Routes>
    </Router>
  );
}

export default App;
